);

create table furnitures (
	id SERIAL,
	type int REFERENCES types(id),
	imageUrl VARCHAR(50),
	name VARCHAR(15),
	price DECIMAL(7,2),
	style VARCHAR(18) CHECK (style IN ('modern','vintage','rustic','industrial','Rustic','minimalist')),
	height DECIMAL(5,2),
	width DECIMAL(5,2),
	depth DECIMAL(4,2),
	PRIMARY KEY(id,name),
	UNIQUE(type,name)

);




